_DESCRIPTION_:
СКАТ SKAT-RLPS.48DC-10 исп.5 - источник питания предназначен для обеспечения бесперебойным питанием систем охранно-пожарной сигнализации, систем видеонаблюдения, средств связи, телекоммуникационного оборудования и других потребителей с номинальным напряжением питания 48В постоянного тока. Кроме того, источник может использоваться в качестве зарядного устройства для свинцово-кислотных АКБ номинальным напряжением 48В и емкостью 12-120А/ч*. Источник имеет герметичное исполнение и рассчитан на круглосуточный режим работы на открытом воздухе и в помещениях с неблагоприятными условиями эксплуатации (повышенным уровнем влажности, содержания пыли и вредных веществ), при температуре окружающей среды от -40ºС до +40ºС и относительной влажности до 100% (при 25ºС). Для размещения АКБ рекомендуется использовать отсеки со степенью защиты не хуже IP56.Источник обеспечивает:
-питание нагрузки стабилизированным напряжением  постоянного тока согласно п.2. таблицы и суммарным током потребления по двум выходам, включая ток заряда АКБ, не более 10 А при наличии сетевого напряжения:
-оптимальный заряд АКБ  при напряжении сети  в диапазоне, указанном в п.1 таблицы:
-ограничение тока заряда АКБ (п.5 таблицы) и возможность выбора одного из трёх значений тока ограничения;
-температурную компенсацию напряжения заряда АКБ при наличии питающей сети в соответствии с  п.1 таблицы (при применении термодатчика АКБ, входящего в комплект поставки);
-поддержание температуры АКБ при низких температурах окружающей среды при наличии питающей сети в соответствии с п.1 таблицы и подключено внешнем устройстве обогрева;
-автоматический переход в режим резервного питания нагрузок от внешней АКБ постоянным напряжением согласно п.2 таблицы и суммарным током потребления по двум выходам не более 10 А при отключении электрической сети (режим «РЕЗЕРВ»);
-защита нагрузки от токовой перегрузки  посредством плавкого предохранителя;
-защиту устройства и нагрузки от неправильного подключения (переполюсовки) клемм АКБ;
-защиту от короткого замыкания клемм АКБ;
-контроль наличия АКБ;
-защиту АКБ от глубокого разряда в режиме «РЕЗЕРВ» путем отключения нагрузки от АКБ при снижении напряжения на клеммах АКБ до уровня, указанного в п.9 таблицы;
-защиту нагрузки потребителя от аварийного повышения напряжения на выходе источника путем автоматического отключения нагрузок;
-светодиодную индикацию наличия напряжения электрической сети: «СЕТЬ»:
-светодиодную индикацию состояния внешней АКБ: «АКБ»;
-светодиодную индикацию состояния напряжения выхода: «ВЫХОД»:
-выдачу информационных диагностических сообщений (подключение внешних цепей индикации) и (или) управление внешними устройствами автоматики замыкающими контактами пяти реле сигнальных выходов;
-защиту питающей сети от короткого замыкания в источнике посредством плавкого предохранителя;
-возможность восстановления работоспособности источника при подключении исправной и -заряженной внешней АКБ и отсутствии  напряжения питающей сети («холодный запуск»);
полную пыле- влаго- защиту при неблагоприятных условиях эксплуатации.Технические характеристики СКАТ SKAT-RLPS.48DC-10 исп.5Напряжение питающей сети, В	220В, 50±1Гц, с пределами изменения от 170 до 250 В
