Напряжение заряда АКБ при наличии сетевого напряжения и температуре окружающей среды 25ºС, В	от 52,5 до 58
Ток нагрузки (суммарный по выходам «Выход 1», «Выход 2» и выходу для питания внешнего устройства обогрева АКБ) максимальный, А при наличии сети 220В, включая ток заряда АКБ)*	10
Максимальный ток заряда АКБ, А**	6, 4 или 2
